import React from "react";
import airportpic from "./airport.jpg";

function Airport() {
  return (
    <div
      style={{
        background: `url(${airportpic})`,
        height: "100%",
        // width: "100%",
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
      }}
    ></div>
  );
}

export default Airport;
